import { Component, OnInit } from '@angular/core';
import { AuthApiService } from "@app-core/services/api/auth.api.service";
import { FormControl, FormGroup, Validators } from "@angular/forms";
import { Router } from "@angular/router";

@Component({
  selector: 'app-auth-login',
  templateUrl: './login.component.html',
})
export class LoginComponent implements OnInit {

  /**
   * Reactive form group
   */
  loginForm!: FormGroup;
  /**
   * Indicates if we are connecting to the server
   */
  isLoading = false;
  /**
   * Indicates if we there is an error coming back from server
   */
  error = "";

  constructor(private authApiService: AuthApiService, private router: Router) {
  }

  ngOnInit(): void {
    // init form
    this._initFormGroup();

  }

  private _initFormGroup() {
    this.loginForm = new FormGroup({
      email: new FormControl('', [
        Validators.email,
        Validators.required
      ]),
      password: new FormControl('', [
        Validators.required,
        Validators.pattern('^(?=.*?[A-Z])(?=.*?[a-z])(?=.*?[0-9])(?=.*?[#?!@$%^&*-]).{8,}$')

      ]),
      keepMeLoggedIn: new FormControl(),
    });
  }

  get email() {
    return this.loginForm.get('email');
  }

  get password() {
    return this.loginForm.get('password');
  }

  get keepMeLoggedIn() {
    return this.loginForm.get('keepMeLoggedIn');
  }

  /**
   * Call submit
   */
  onFormSubmit() {
    this.isLoading = true;
    this.error = "";
    this.authApiService.login({
      password: this.password?.value,
      email: this.email?.value,
      keep_me_logged_in: String(!!this.keepMeLoggedIn?.value),
    }).subscribe((res) => {
      setTimeout(() => {
        if (!res) {
          this.error = "Something went wrong, please try again .";
          return;
        }
        this.router.navigateByUrl('/home');
      }, 1000);

    }, (err) => {

    }, () => {
      setTimeout(() => {
        this.isLoading = false;
      }, 1000)
    })
  }
}

